const img = 'data:image/jpg;base64,';


$(`
<div class="img-container hidden23">
  <img id="js-img" class="" src="${img}"/>
</div>
<style>
    .img-container {
        position: absolute;
        top: 0;
        left: 0;
        display: flex;
        justify-content: center;
        align-items: center;
        height: 100%;
        width: 100%;
    }
    .hidden23 {
       display: none;
    }
    #js-img {
        width: 25%;
    }
</style>
`).appendTo(document.body);

  var a = document.getElementById('js-img');
  a.style = 'cursor: zoom-in;'
  a.addEventListener('mouseover', (ev) => {
    a.style = 'cursor: all-scroll;'
  });
  a.addEventListener("mousemove", (ev) => {
    const x = ev.x - ev.target.offsetLeft;
    const y = ev.y - ev.target.offsetTop
    ev.target.style = `cursor: all-scroll;transform: scale(3); transform-origin: ${x}px ${y}px;`
  });
  a.addEventListener("click", (ev) => {
    $florrMapBig.toggleClass('hidden23');
  });
var $florrMapBig = $('.img-container')
document.addEventListener("keyup", (e) => {
    if (e.code === "KeyN" && e.altKey) {$florrMapBig.toggleClass('hidden23'); a.style = 'cursor: all-scroll;'}
    return e.preventDefault();
});